    const CUser = JSON.parse(window.localStorage.getItem('cUser'));
    const Logout = () => {
        window.localStorage.removeItem("cUser");
        window.location.href = "/";
    };

    const [sidebarExists, setsidebarExists] = useState(false);
    return (
        <Navbar fluid>
            <Navbar.Header>
                <Navbar.Brand>
                    {/* <a href="#pablo">{this.props.brandText}</a> */}
                </Navbar.Brand>
                {/* <Navbar.Toggle onClick={this.mobileSidebarToggle} /> */}
            </Navbar.Header>
            <Navbar.Collapse>
                <AdminNavbarLinks />
            </Navbar.Collapse>
        </Navbar>
    );
}

